def calc_z_l(ell: int, real_only: bool = False) -> np.ndarray:
    """Return spherical Bessel zeros for angular momentum ell.

    These are the complex zeros of the spherical Hankel function
    or equivalently of theta_ell(z) = (d/dz)^ell [sin(z)/z] / z.

    Parameters
    ----------
    ell : int
        Angular momentum quantum number (0 to 60).
    real_only : bool, default=False
        If True, return unique real parts and absolute imaginary parts
        (for constructing real-valued matrices).

    Returns
    -------
    np.ndarray
        Complex zeros (shape (ell,) typically), or real array if real_only=True.
    """
    max_ell = max(_Z_L_P.keys())
    if ell < 0 or ell > max_ell:
        raise ValueError(f"ell must be 0-{max_ell}, got {ell}")

    z_l_p = _Z_L_P[ell].copy()

    if real_only:
        # Return unique real and |imag| values, excluding zeros
        combined = np.concatenate([z_l_p.real, np.abs(z_l_p.imag)])
        result = np.unique(combined)
        result = result[result != 0]
        return result

    return z_l_p
